function generateNamesAndIds(pokemon) {
    var names = [];
    for (var id in pokemon) {
        names.push({name: pokemon[id].name, id: id})
    }
    return names.sort(function(a, b) {
        return a.name.localeCompare(b.name)
    });
}

export const pokemonNamesAndIds = generateNamesAndIds(pokemon);

